(function ( $ ) {
    $.fn.float = function() {
        $(this).each(function(i,e) {
            if ($(e).prop("nodeName") == "INPUT") {
                if ($(e).attr("placeholder") !== undefined) {
                    if (!$("*").hasClass("_jQuery_float_Container"))
                        $('head').append("<style type='text/css'>input[float]:focus::-webkit-input-placeholder{opacity:.5}input[float]:focus{border:0;outline:0}input[float]{padding-left:5px;padding-right:25px;border:0;height:22px;float:left;width:180px;box-sizing:content-box}span._jQuery_float_X{position:absolute;margin-left:-25px;margin-top:3px;width:20px;text-align:center;box-sizing:content-box;font:Segoe UI,Lucida Sans Unicode,Verdana;background:url(data:image/png;base64,)}span._jQuery_float_X:hover{background:url(data:image/png;base64,) #e0e0e0;color:#56acdb;cursor:pointer}span._jQuery_float_placeholder{position:absolute;margin-top:10px;font-size:11.1px;padding-left:8px;opacity:0;color:#56acdb;background:#FFF;box-sizing:content-box}div._jQuery_float_Container{text-align:left;border:1px solid #ccc;border-radius:2px;width:210px;height:28px;margin:10px 0;background:#FFF;box-sizing:content-box}</style>");
                    var Placeholder = $(e).attr("placeholder");
                    var toAdd=[0,0,0];
                    var Bootstrap=false;
                    var cObj = $('<div class="_jQuery_float_Container"></div>');
                    var pObj = $('<span class="_jQuery_float_placeholder">'+Placeholder+'</span>');
                    var xObj =    $('<span class="_jQuery_float_X">&nbsp;</span>');
                    var tObj = $(e);
                    if (tObj.hasClass("form-control")) {
                        var Bootstrap=true;
                        toAdd=[10,4,parseInt(tObj.css("padding-top")[0])];
                        cObj.css("height","35px");
                        cObj.css("border-radius","10px");
                        tObj.css("border-radius","10px");
                        pObj.css("border-radius","10px");
                        xObj.css("margin-top","7px");
                    }
                    tObj.before(cObj);
                    cObj.prepend(pObj);
                    tObj.appendTo(cObj);
                    cObj.append(xObj);
                    tObj.attr("float","");
                    var Mark=false;
                    var Focus=false;
                    tObj.keydown(function() {
                        Mark=true;
                        if (tObj.attr("placeholder") != Placeholder) {
                            Placeholder = tObj.attr("placeholder");
                            pObj.html(Placeholder);
                        }
                    });
                    tObj.keyup(function() {
                        var Obj=[,,];
                        if (tObj.val() === "") {
                            Obj[0]=(Bootstrap)?35:28 + toAdd[0];
                            Obj[1]=3 + toAdd[1];
                            Obj[2]=toAdd[2];
                            console.log(Obj);
                            pObj.animate({opacity:"0","margin-top":"10px"},150);
                            tObj.animate({"padding-top":Obj[2]+"px"},150);
                            cObj.animate({height:Obj[0]+"px"},150);
                            xObj.animate({"margin-top":Obj[1]+"px"},150);
                        }
                        else if (Mark === true) {
                            Obj[0]=38 + toAdd[0];
                            Obj[1]=7.5 + toAdd[1];
                            Obj[2]=14 + toAdd[2];
                            console.log(Obj);
                            tObj.animate({"padding-top":Obj[2]+"px"},150);
                            pObj.animate({opacity:"0.8","margin-top":"2px"},150);
                            xObj.animate({"margin-top":Obj[1]+"px"},150);
                            cObj.animate({height:Obj[0]+"px"},150);
                            Mark=false;
                        }
                    });
                    xObj.click(function() {
                        if (tObj.val() !== "") {
                            tObj.val("");
                            var Obj=[,,];
                            Obj[0]=(Bootstrap)?35:28 + toAdd[0];
                            Obj[1]=3 + toAdd[1];
                            Obj[2]=toAdd[2];
                            pObj.animate({opacity:"0","margin-top":"10px"},150);
                            tObj.animate({"padding-top":Obj[2]+"px"},150);
                            cObj.animate({height:Obj[0]+"px"},150);
                            xObj.animate({"margin-top":Obj[1]+"px"},150);
                        }
                    });
                    tObj.focusout(function() {
                        pObj.css("color","#000");
                        if (!Bootstrap)
                            cObj.css("border","1px solid rgb(204,204,204)");
                        Focus=false;
                    });
                    tObj.focus(function() {
                        pObj.css("color","rgb(86,172,219)");
                        if (!Bootstrap) 
                            cObj.css("border","1px solid rgb(127,127,127)");
                        Focus=true;
                    });
                    tObj.mouseenter(function() {
                        if (!Focus && !Bootstrap) 
                            cObj.css("border","1px solid rgb(127,127,127)");
                    });
                    tObj.mouseleave(function() {
                        if (!Focus && !Bootstrap)
                            cObj.css("border","1px solid rgb(204,204,204)");
                    });
                }
            }
        });
    };
})(jQuery);
